import { Component, OnInit } from '@angular/core';
import { FormGroup } from "@angular/forms"

import { DynamicFormBuildConfig, RxDynamicFormBuilder } from "@rxweb/reactive-dynamic-forms";
import { HttpClient } from '@angular/common/http';

@Component({
    selector: 'app-dynamicalpha-dynamic',
    templateUrl: './dynamicalpha-dynamic.component.html'
})

export class DynamicalphaDynamicComponent implements OnInit {
serverData:any;
 uiBindings: string[];
  dynamicFormBuildConfig: DynamicFormBuildConfig;

 constructor(private formBuilder: RxDynamicFormBuilder, private http:HttpClient) { }
   ngOnInit() {
   this.http.get('assets/examples/dynamic-validations/dynamicalpha').subscribe(res => {
        this.serverData = res;    
   this.dynamicFormBuildConfig = this.formBuilder.formGroup(this.serverData); 
   });
   }
}
